	[TestFixture]
	public class PppGeneratorTests
	{
		PppGenerator ppp;

		#region helper
		private void testKnownGood(BigInteger offset, string[] knownGood)
		{
			for (int i = 0; i < knownGood.Length; i++)
			{
				BigInteger passcodeNumber = offset + i;
				string expected = knownGood[i];
				string actual = ppp.GetPasscode(passcodeNumber);
				Assert.AreEqual(expected, actual, String.Format("Passcode {0} did not match!", passcodeNumber));
			}
		}
		#endregion //helper

		[SetUp]
		public void Setup()
		{
			byte[] key = pppHelper.GetSequenceKeyFromPassword("zombie");
			ppp = new PppGenerator(key);
		}

		[Test]
		public void HexStringSequenceKey()
		{
			//The default ppp instance is setup with a byte key so we 
			//should be able to create a new instance with a string then
			//compare the sequence keys
			string hexStringKey = PppConvert.ByteArrayToString(pppHelper.GetSequenceKeyFromPassword("zombie"));
			PppGenerator stringPpp = new PppGenerator(hexStringKey);
			Assert.AreEqual(hexStringKey, stringPpp.SequenceKeyHex, "Hex sequence key does not match what was given!");
			Assert.AreEqual(ppp.SequenceKey, stringPpp.SequenceKey, "Setting sequence key with a hex string did not appear to work!");			
		}

